  02> MURRAY, Catherine Rose
  b 05.04.1990
  Catherine b. at Auckland. She is being educated at Wakaaranga Primary School and is very
  musical.
  02> DAVIES, Stephen Godfrey M on 02.10.1982 to (1) TOWNER, Michele
  b 01.11.1955
  b ** ** ****
  Stephen b. at Auckland and m. at St John the Baptist Church, Surrey, England. Divorced in
  Australia. Michele, d/o an architect.
  02> DAVIES, Stephen Godfrey M on 15.03.1987 to (2) HERRICK, Karin
  b 01.11.1955
  b ** ** ****
  Stephen m. at Washington, DC, USA. Divorced 1997. Karin, dlo a prominent German scientist.
  Stephen was educated at Glen Taylor Primary School, Glen Innes Intermediate and Glendowie College,
  where he played soccer and hockey. He was also a keen sailor at the local boat club. After
  completing an architectural draughting course at Auckland Technical Institute he worked for the
  Auckland Harbour Board. In 1980 he moved to Sydney, Australia to further his career and in 1987 he
  moved to Washington, DC, USA where he completed his qualifications and is now working as an
  architect.
  03> DAVIES, Rosemary Allison
  b 19.03.1960
  Rosemary b. at Auckland. She was educated at Glen Taylor Primary School, Glen Innes Intermediate
  and Glendowie College. She attended Auckland Technical Institute doing the Senior Business Course
  and is now working as a secretaryl receptionist. Her interests include cooking, movies and reading.
  03> DAVIES, John Douglas Geoffrey m on 23.04.1946 to HARRIS, Gertrude Melba
  Elizabeth
  b 03.02.1926
  b 30.03.1925
  Twin. Douglas b. at Napier and m. at Christchurch. Melba, dlo Horace Edmund
  Harris and Gertrude Selina Pegley, b, at Christchurch. Address: 20A East Coast
  Road, Milford, Auckland.
  Douglas was a Farm Cadet at Lincoln College (1941-43) and graduated Dip Ag and
  Dip Ag Sc. His memberships include MNZIAS and MNZSFM and he is an Hon Life
  Member of the NZ Tree Crops Association. He worked as a livestock officer in
  Fiji (1947-50), a farm advisory officer with MAF (1951-65), Chief Agronomist with KP (1965-72) and as a
  scientist with DSIR Crops (1972-86).
  He was Chairman of the Lake Edge Development Company, Kaitorete Spit, Canterbury (1965-73) farming
  Merino wethers and dairy beef. In 1993 he participated with Lincoln University as main author of the
  book, "Waihora Lake Elesmere - Past, Present and Future", a posterity publication that includes 20
  contributors from scientific, Maori and farming communities. He enjoys the fellowship of Takapuna
  North Probus and served as President in 1995. Currently he is president of the Overlanders Travel
  Club, Greenlane.
  Like his grandfather, Douglas follows the All Blacks with whom he travelled to the historic 3rd test
  against the Springboks in 1956.
  Melba trained as a Karitane nurse. She is a keen gardener and travels widely.
